💙 HOLIDAY HOME TOUR 💙

Growing up, I remember my mom had a box or two of Hanukkah decorations that she’d bring out every year and we’d decorate the living and dining rooms with the silver and blue mylar banners, star garlands, and dreidels. It’s a memory I cherish. This year, I wanted to incorporate some of those sentimental pieces for my kids while also putting my own twist on Hanukkah decor. I created a grandmillenial Hanukkah tablescape, if you will, with lots of blue and white tones and silvery accents. I’ve been disappointed by the lack of elegant Hanukkah decor available but am happy with how my table and decor turned out. I just hope to see more options available in the future, for people like me who appreciate elegant and classic decor! So happy to be sharing my holiday home tour this week and make sure to follow along with my friends who are sharing their homes this week as well:

